import React from 'react';
import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';

function ModalComponent(props) {
  const { imageUrl, show, onHide } = props;

  return (
    <Modal show={show} onHide={onHide} className="flex items-center justify-center">
      <div className="bg-white w-full md:max-w-md mx-auto rounded-lg shadow-lg z-50 overflow-y-auto">
        <Modal.Header closeButton>
          <Modal.Title>Type Image</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <img src={imageUrl} alt="Type" className="w-full h-auto" />
        </Modal.Body>
        <Modal.Footer className="bg-gray-100">
          <Button variant="secondary" onClick={onHide}>
            Close
          </Button>
        </Modal.Footer>
      </div>
    </Modal>
  );
}

export default ModalComponent;
